import './App.css';

import React, { Component } from 'react';
import { render } from 'react-dom';

class Calendar extends Component {
  constructor(props){
    super(props);
    this.state = {
      'loading': true
    };
    this.url = 'http://slack-server-production.us-west-2.elasticbeanstalk.com/calendar/NY/28';
    this.calData = [];
  }

  async componentDidMount(){
    //fetch calendar data
    const response =  await fetch(this.url)
    const data = await response.json();
    for(const key in data) {
      this.calData.push(data[key]);
    };
    this.setState({'loading': false});
    console.log(data);
    console.log(this.state);
  }

  displayDay(key){
    return this.state.loading ? "loading..." : this.calData[key][0]['created'];
  }

  render() {
    return (
      <div>
        <h1>Calendar</h1>
        <Day eventArray={this.calData[0]}/>
      </div>
    );
  }
}

